import React from 'react';

export const Header = () => {
  return (
    <div className='justify-center text-slate-100 mt-10 sm:mt-20 md:mt-32 lg:mt-72'>
      <div className='text-4xl sm:text-6xl md:text-8xl lg:text-9xl font-bold'>
        Cory Carroll
      </div>
      <div className='mt-10 sm:mt-20 md:mt-32 lg:mt-40'>
        <p className='text-base sm:text-lg md:text-2xl lg:text-3xl'>
          I am a Full Stack Web Developer based in Salt Lake City, Utah. I am currently open to work and am actively seeking employment.
        </p>
      </div>
    </div>
  );
};

export default Header;
